package llc.arma.checklisttag.net;import java.util.List;import java.util.Map;import lombok.AllArgsConstructor;import lombok.Getter;@Getterpublic class WebObject {    private final Attr attr;    private final Map<String, Object> data;    private List<WebObject> childs;    public WebObject(Attr attr, Map<String, Object> data) {        this.attr = attr;        this.data = data;    }    @Getter    @AllArgsConstructor    public static class Attr{        private final String sid;        private final String type;        private final String parent;        private final String tablet;        private final Long login;        private final Integer sync;        private final Integer show;        private final Long ts;        private final Long lastupd;        private final String channel;        private final String name;        private final Long deadin;    }}